import "./index.css";

function ReturnBook() {
    return (
        <div className="all">
            <div className="all-innner">
                <div className="header">归还书籍</div>
                <div className="return-bar"></div>
                <div className="return-content">内容</div>
            </div>
        </div>
    )
}

export default ReturnBook;
